import React from 'react';
import CountUp from 'react-countup';

const stats = [
  { label: 'Districts Covered in Maharashtra', value: 13 },
  { label: 'Indigenous Trees Planted', value: 455000 },
  { label: 'Years in Tree Conservation', value: 6 },
  { label: 'Devrai Developed in Maharashtra', value: 40 },
];

const StatsCounter = () => {
  return (
    <section
      className="py-16 px-5 bg-cover bg-center bg-no-repeat"
      style={{ backgroundImage: "url('data:image/jpeg;base64,')" }}
    >
      <div className="bg-white bg-opacity-80 backdrop-blur-sm  mx-auto grid grid-cols-1 md:grid-cols-4 gap-6 text-center rounded-xl p-6 shadow-lg">
        {stats.map((stat, index) => (
          <div key={index} className="p-4">
            <h3 className="text-4xl font-bold text-green-800 drop-shadow-md">
              <CountUp end={stat.value} duration={2} separator="," />
              {stat.label.includes('Trees') ? '+' : ''}
            </h3>
            <p className="text-gray-700 mt-2 font-medium">{stat.label}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default StatsCounter;
